import React from "react";
import { Link } from "react-router-dom";
import {Swiper, SwiperSlide} from 'swiper/react';
import { FreeMode } from "swiper";
import 'swiper/css';
import 'swiper/css/free-mode';
import VehicleCard from "./VehicleCard";
import img1 from 'https://content.jdmagicbox.com/comp/mumbai/n7/022pxx22.xx22.180328045415.k9n7/catalogue/s-m-carz-borivali-west-mumbai-second-hand-car-dealers-yqx9eilx8l.jpg?clr=523314';
import img2 from 'https://content.jdmagicbox.com/comp/mumbai/n7/022pxx22.xx22.180328045415.k9n7/catalogue/s-m-carz-borivali-west-mumbai-second-hand-car-dealers-yqx9eilx8l.jpg?clr=523314';
import img3 from 'https://content.jdmagicbox.com/comp/mumbai/n7/022pxx22.xx22.180328045415.k9n7/catalogue/s-m-carz-borivali-west-mumbai-second-hand-car-dealers-yqx9eilx8l.jpg?clr=523314';
import img4 from 'https://content.jdmagicbox.com/comp/mumbai/n7/022pxx22.xx22.180328045415.k9n7/catalogue/s-m-carz-borivali-west-mumbai-second-hand-car-dealers-yqx9eilx8l.jpg?clr=523314';
import img5 from 'https://content.jdmagicbox.com/comp/mumbai/n7/022pxx22.xx22.180328045415.k9n7/catalogue/s-m-carz-borivali-west-mumbai-second-hand-car-dealers-yqx9eilx8l.jpg?clr=523314';

function VehicleSlider(){
    return (
        <div>
            <Swiper
                FreeMode={true}
                grabCursor={true}
                modules={[FreeMode]}
                className="mySwiper"
                slidesPerView={4}
                spaceBetween={10}
            >
                
                <SwiperSlide>
                    <Link to="/vehicle-details">
                        <VehicleCard data={{imgSrc:img1, title:"Premium Car Dealers", location:'Mumbai', rating:2.5, review:12}} />
                    </Link>
                </SwiperSlide>

            </Swiper>
        </div>
    );
}

export default VehicleSlider
